import "./Header.css";
import TeslaLogo from "../assets/teslaLogoSmall.svg";
const Header = () => {
    return (
        <div className="header">
            <div className="header__logo">
                <img src={TeslaLogo} alt="Testla Logo"/>
            </div>
            <div className="header__center">
                <p></p>
                <p></p>
                <p></p>
                <p></p>
                <p></p>
                <p></p>
            </div>
        </div>
    )
}

export default Header
